import React, {useEffect, useState} from 'react'
import axois from 'axios'
import Book from './Book'
function Books() {
    const [books, setBooks] = useState();
    useEffect(()=>{
        axois.get("http://localhost:5000/").
        then(res =>{
            const data = res.data;
            setBooks(data);
            console.log(books);
        }).catch(err=>{
            console.log(err);
        })
    },[books])
    return (
        <div>
            {books.map( (book) => {
                <Book name={book.name} />
            })}
        </div>
    )
}

export default Books
